import React, { useState } from "react";
import "./App.css";

const childrenOptions = [0, 1, 2, 3, 4, 5];
const regionOptions = ["southeast", "southwest", "northeast", "northwest"];
const smokerOptions = ["yes", "no"];

function App() {
  const [age, setAge] = useState("");
  const [gender, setGender] = useState("");
  const [bmi, setBmi] = useState("");
  const [children, setChildren] = useState("");
  const [isSmoker, setIsSmoker] = useState("");
  const [region, setRegion] = useState("");
  const [charges, setCharges] = useState(null);

  // Function to handle form submission
  const handleSubmit = async () => {
    const requestData = {
      age,
      gender,
      bmi,
      children,
      isSmoker,
      region,
    };

    try {
      const response = await fetch("https://your-api-url.com/predict", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(requestData),
      });

      const data = await response.json();
      setCharges(data.charges);
    } catch (error) {
      console.error("Error fetching charges:", error);
      setCharges("Error calculating charges");
    }
  };

  return (
    <div className='App'>
      <h2 className='title' style={{ fontSize: 30 }}>
        Medical Insurance Cost Prediction
      </h2>

      {/* Age Input */}
      <label className='title'>Enter Age:</label>
      <input
        type='number'
        value={age}
        onChange={(e) => setAge(e.target.value)}
        placeholder='30'
      />

      {/* Gender Selection */}
      <label className='title'>Select Gender:</label>
      <select
        id='gender'
        value={gender}
        onChange={(e) => setGender(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        <option value='male'>Male</option>
        <option value='female'>Female</option>
      </select>

      {/* BMI Input */}
      <label className='title'>BMI:</label>
      <input
        type='number'
        value={bmi}
        onChange={(e) => setBmi(e.target.value)}
        placeholder='27.99'
      />

      {/* Number of Children Selection */}
      <label className='title'>Number of Children:</label>
      <select
        id='children'
        value={children}
        onChange={(e) => setChildren(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        {childrenOptions.map((num) => (
          <option key={num} value={num}>
            {num}
          </option>
        ))}
      </select>

      {/* Smoker Status */}
      <label className='title'>Are you a smoker?</label>
      <select
        id='smoker'
        value={isSmoker}
        onChange={(e) => setIsSmoker(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        {smokerOptions.map((option) => (
          <option key={option} value={option}>
            {option === "yes" ? "Yes" : "No"}
          </option>
        ))}
      </select>

      {/* Region Selection */}
      <label className='title'>Select your region:</label>
      <select
        id='region'
        value={region}
        onChange={(e) => setRegion(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        {regionOptions.map((reg) => (
          <option key={reg} value={reg}>
            {reg.charAt(0).toUpperCase() + reg.slice(1)}
          </option>
        ))}
      </select>

      {/* Submit Button */}
      <button onClick={handleSubmit}>Calculate Insurance Cost</button>

      {/* Display Charges */}
      {charges !== null && (
        <div>
          <h3>Predicted Charges: ${charges}</h3>
        </div>
      )}
    </div>
  );
}

export default App;
